import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import "../../styles/ThreePL.css";

/* SLIDESHOW IMAGES (gallery18‚Äì41) */
const images = [];
for (let i = 18; i <= 41; i++) {
  images.push(require(`../../assets/gallery/images/gallery${i}.jpg`));
}

function ThreePL() {
  const [heroIndex, setHeroIndex] = useState(0);
  const [mainIndex, setMainIndex] = useState(0);

  /* HERO SLIDESHOW */
  useEffect(() => {
    const heroTimer = setInterval(() => {
      setHeroIndex((prev) => (prev + 1) % images.length);
    }, 4000);
    return () => clearInterval(heroTimer);
  }, []);

  /* MAIN SLIDESHOW */
  useEffect(() => {
    const mainTimer = setInterval(() => {
      setMainIndex((prev) => (prev + 1) % images.length);
    }, 3200);
    return () => clearInterval(mainTimer);
  }, []);

  return (
    <div className="rgm-3pl-page">

      {/* HERO WITH SLIDESHOW */}
      <section
        className="rgm-3pl-hero"
        style={{ backgroundImage: `url(${images[heroIndex]})` }}
      >
        <div className="hero-content">
          <h1>RGM Logistics</h1>
          <p>
            Reliable ‚Ä¢ Transparent ‚Ä¢ Family-Driven Third-Party Logistics
          </p>
        </div>
      </section>

      {/* INTRO */}
      <section className="rgm-3pl-intro">
        <blockquote>
          ‚ÄúEven at the last minute, we can rely on RGM to find the right solution.
          Communication is clear, honest, and dependable ‚Äî it truly feels like
          working with a partner, not just a provider.‚Äù
          <span>‚Äî RGM Logistics Partner</span>
        </blockquote>
      </section>

      {/* WHY 3PL */}
      <section className="rgm-3pl-why">
        <h2>Why Work With a Third-Party Logistics Provider?</h2>
        <p>
          By partnering with <strong>RGM Logistics</strong>, you gain flatbed-focused
          expertise, trusted carrier relationships, and smart freight solutions ‚Äî
          while staying focused on growing your business.
        </p>
      </section>

      {/* MAIN SLIDESHOW */}
      <section className="rgm-3pl-slideshow">
        <div className="slideshow-frame">
          <img src={images[mainIndex]} alt="RGM Fleet" />
        </div>
      </section>

      {/* ADVANTAGES */}
      <section className="rgm-3pl-advantages">
        {[
          ["üöõ Flatbed Expertise", "Deep knowledge of securement and scheduling."],
          ["üí∞ Smarter Pricing", "Optimized routes without sacrificing safety."],
          ["üéØ Specialized Freight", "Construction, steel, and oversized loads."],
          ["‚≠ê Reliable Delivery", "Clear communication & trusted carriers."]
        ].map(([title, text], i) => (
          <div className="adv-card" key={i}>
            <h3>{title}</h3>
            <p>{text}</p>
          </div>
        ))}
      </section>

      {/* SERVICES */}
      <section className="rgm-3pl-services">
        <h2>Our Flatbed 3PL Services</h2>
        <div className="service-grid">
          <span>Flatbed Truckload</span>
          <span>Construction Materials</span>
          <span>Steel & Metal</span>
          <span>Machinery & Equipment</span>
          <span>Oversized Freight</span>
          <span>Project-Based Shipping</span>
        </div>
      </section>

      {/* CTA */}
      <section className="rgm-3pl-cta">
        <h2>Let‚Äôs Move Your Flatbed Freight Forward</h2>
        <p>Built on trust, communication, and family values.</p>

        <div className="cta-buttons">
          <Link to="/contact" className="cta-primary">Get A Quote</Link>
          <Link to="/contact" className="cta-secondary">Click to Call</Link>
        </div>
      </section>

    </div>
  );
}

export default ThreePL;
